import React, { useEffect } from 'react';

const App = () => {

  useEffect(() => {
    fetch('/api/customers/')
    .then(response => {
      console.log(response);

      response.json()
      .then(data => {
        console.log(data);
      })
    })
    .catch(error => {
      console.error(error);
    });
  }, [])

  return (
    <div>
      this is my app
    </div>
  );
}

export default App;
